content:
fade
vi.	褪去，失去光泽; 逐渐消逝; 凋谢，衰老;
vt.	使褪色;
adj.	乏味的，平淡的;
[例句]All colour fades ― especially under the impact of direct sunlight
所有颜色都会褪色――尤其是在阳光直射下。
[其他]	第三人称单数：fades 现在分词：fading 过去式：faded 过去分词：faded

